import React from 'react';
import styles from './Sidebar.module.css';

const Sidebar = () => {

  return (
    <div className={styles.sidebar}>
      <h2>
        Drinks
      </h2>
      <h2>
        Food
      </h2>
      <h2>
        At Home Coffee
      </h2>
      <h2>
        Merchandise
      </h2>
    </div>
  );
};

export default Sidebar;
